// function formatDate((date) => {
//     new Intl.DateTimeFormat("en", {
//         day: "numeric",
//         month: "long",
//         year: "numeric",
//         weekday: "long",
// }).format(new Date(date))

const formatDate = (date) =>
  new Intl.DateTimeFormat("en", {
    day: "numeric",
    month: "long",
    year: "numeric",
    weekday: "long",
  }).format(new Date(date));

export default formatDate;
